import React, {useState} from 'react'

import {
    Button,
    Table,
    TableContainer,
    Box,
    TableHead,
    TableBody,
    TableRow,
    TableCell,
    Container,
    MenuItem,
    Menu,
    TablePagination,
  

    
    
} from '@mui/material'
import MoreVertIcon from '@mui/icons-material/MoreVert'
import PropTypes from 'prop-types';
import IconButton from '@mui/material/IconButton';
import FirstPageIcon from '@mui/icons-material/FirstPage';
import KeyboardArrowLeft from '@mui/icons-material/KeyboardArrowLeft';
import KeyboardArrowRight from '@mui/icons-material/KeyboardArrowRight';
import LastPageIcon from '@mui/icons-material/LastPage';
import { useTheme } from '@mui/material/styles';



const Import = (props) => {
    // fill out this component
    console.log(props)
// *pagination

const theme = useTheme();
const [page, setPage] = React.useState(0);
const [rowsPerPage, setRowsPerPage] = React.useState(5);
const [makes] = React.useState([]);
const { count, onPageChange } = props;

const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = event => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };
  const emptyRows =
    rowsPerPage - Math.min(rowsPerPage, makes.length - page * rowsPerPage);

    const handleFirstPageButtonClick = (event) => {
        onPageChange(event, 0);
      };
    
      const handleBackButtonClick = (event) => {
        onPageChange(event, page - 1);
      };
    
      const handleNextButtonClick = (event) => {
        onPageChange(event, page + 1);
      };
    
      const handleLastPageButtonClick = (event) => {
        onPageChange(event, Math.max(0, Math.ceil(count / rowsPerPage) - 1));
      };
      

























    const [anchorEl, setAnchorEl] = React.useState(null);

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    }
    const handleClose = () => {
        setAnchorEl(null);
      };
    const [deleteMakes] = useState(null);

    const handleDeletes = (index) => {
        props.deleteMakes(deleteMakes, index)
        setAnchorEl(null);
    }

    return (
      
        <Container>
              <br />
              <br />
        <Button
            variant="contained"
            color="primary"
            onClick={props.fetchMakes}>Import</Button>
            
            <h2> Count: {props.makes.length}</h2>

            <TableContainer>
            <Table>
            <TableHead>
                <TableRow>
                    <TableCell>Id</TableCell>
                    <TableCell>Make</TableCell>
                    <TableCell>Actions</TableCell>
                </TableRow>
            </TableHead>
            <TableBody>
            {props.makes.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
          
            .map((makes, index) => (
          
                    <TableRow key={index}>
                        <TableCell>{makes.MakeId}</TableCell>
                        <TableCell>{makes.MakeName}</TableCell>
                        <TableCell>
                            <MoreVertIcon onClick={handleClick} />
                         
                            <Menu   
                                    id="basic-menu"
                                    anchorEl={anchorEl}
                                    keepMounted
                                    open={Boolean(anchorEl)}
                                    onClose={handleClose}
                                 
                                    
                                >
                                    <MenuItem onClick={handleDeletes}>Delete</MenuItem>
                                    <MenuItem onClick={handleClose}>Close</MenuItem>
                                </Menu>
                                                        
                         </TableCell>   
                    </TableRow>
                    
                    
            ))}
            
            

        {emptyRows > 0 && (
              <TableRow style={{ height: 1 * emptyRows }}>
                <TableCell colSpan={6} />
              </TableRow>
            )}
            </TableBody>
        </Table>

   
   
   {/* pagination */}
   <TablePagination
        rowsPerPageOptions={[5, 10, 25, { label: 'All', value: -1 }]}
        component="div"
        count={makes.length}
        rowsPerPage={rowsPerPage}
        page={page}
        SelectProps={{
            inputProps: {
              "aria-label": "rows per page"
            },
          
          }}
        onPageChange={handleChangePage}
        onRowsPerPageChange={handleChangeRowsPerPage}
        // ActionsComponent={TablePaginationActions}
      />
      <Box sx={{ flexShrink: 0, ml: 2.5 }}>
      <IconButton
        onClick={handleFirstPageButtonClick}
        disabled={page === 0}
        aria-label="first page"
      >
        {theme.direction === 'rtl' ? <LastPageIcon /> : <FirstPageIcon />}
      </IconButton>
      <IconButton
        onClick={handleBackButtonClick}
        disabled={page === 0}
        aria-label="previous page"
      >
        {theme.direction === 'rtl' ? <KeyboardArrowRight /> : <KeyboardArrowLeft />}
      </IconButton>
      <IconButton
        onClick={handleNextButtonClick}
        disabled={page >= Math.ceil(count / rowsPerPage) - 1}
        aria-label="next page"
      >
        {theme.direction === 'rtl' ? <KeyboardArrowLeft /> : <KeyboardArrowRight />}
      </IconButton>
      <IconButton
        onClick={handleLastPageButtonClick}
        disabled={page >= Math.ceil(count / rowsPerPage) - 1}
        aria-label="last page"
      >
        {theme.direction === 'rtl' ? <FirstPageIcon /> : <LastPageIcon />}
      </IconButton>
    </Box>
     

        </TableContainer>
     
       
    








      
</Container>
        
    )
}

export default Import
